import itemList from './itemList.json'

function ItemList() {
    return (
        <div className="item_list">
            <div className="category">
                <h3>Drinks</h3>
                <div className='menuList__items'>
                    {itemList.map((itemCategory) =>
                        itemCategory.drinks.map((item) => (
                            <Link>{item.type}</Link>
                        ))
                    )}
                </div>
            </div>
            <div className="category">
                <h3>Food</h3>
                <div className='menuList__items'>
                    {itemList.map((itemCategory) =>
                        itemCategory.food.map((item) => (
                            <Link>{item.type}</Link>
                        ))
                    )}
                </div>
            </div>
            <div className="category">
                <h3>At Home Coffee</h3>
                <div className='menuList__items'>
                    {itemList.map((itemCategory) =>
                        itemCategory.atHomeCoffee.map((item) => (
                            <Link>{item.type}</Link>
                        ))
                    )}
                </div>
            </div>
            <div className="category">
                <h3>Merchandise</h3>
                <div className='menuList__items'>
                    {itemList.map((itemCategory) =>
                        itemCategory.merchandise.map((item) => (
                            <Link>{item.type}</Link>
                        ))
                    )}
                </div>
            </div>
        </div>
    );
}

export default ItemList
